import React from 'react';
import { Grid } from 'semantic-ui-react';

const Homepage = () => {
	return (
		<div>
			<h1>Four Walls of Iron</h1>
			<Grid>
				<Grid.Row columns={2}>
					<Grid.Column>
						{'Strength'}
					</Grid.Column>
					<Grid.Column>
						{'Bodybuilding'}
					</Grid.Column>
				</Grid.Row>
			</Grid>
		</div>
	)
}

export default Homepage;
